import React from 'react'
import * as FaIcons from 'react-icons/fa';

import {Link} from 'react-router-dom ';
function SideBar () {
  return (
    <> 
        <div className = "SideBar">
            <Link to = "#" className = "menu-bars">
                <FaIcons.FaBars/>
            </Link> 
        </div> 
    </>
  )
}

export default SideBar
